sys_variable_value.value:
(function execute(inputs, outputs) {
    try{
        var digest = new GlideDigest();
        if(inputs.algorithm === 'MD5' && inputs.output_type === 'Base64'){
            outputs.digest = digest.getMD5Base64(inputs.string);
        }else if(inputs.algorithm === 'MD5' && inputs.output_type === 'Hexadecimal'){
            outputs.digest = digest.getMD5Hex(inputs.string);
        } else if(inputs.algorithm === 'SHA1' && inputs.output_type === 'Base64'){
            outputs.digest = digest.getSHA1Base64(inputs.string);
        }else if(inputs.algorithm === 'SHA1' && inputs.output_type === 'Hexadecimal'){
            outputs.digest = digest.getSHA1Hex(inputs.string);
        } else if(inputs.algorithm === 'SHA256' && inputs.output_type === 'Base64'){
            outputs.digest = digest.getSHA256Base64(inputs.string);
        }else if(inputs.algorithm === 'SHA256' && inputs.output_type === 'Hexadecimal'){
            outputs.digest = digest.getSHA256Hex(inputs.string);
        }
    } catch(ex){
        outputs.error = ex + "";
    }
})(inputs, outputs);

